import styled from 'styled-components';

export const Home = () => {
  return (
    <Header>
      <h1>lachambre online store</h1>
      <Subtitle>
        <p>Brand</p>
        <p>Allitems</p>
        <p>about</p>
        <p>contucts</p>
      </Subtitle>
    </Header>
  );
};

const Header = styled.header`
  background-color: #ffb6c1;
  width: 100%;

  margin-top: 0%;
  padding: 0%;
`;

const Subtitle = styled.div`
  display: flex;
  gap: 16px;
  justify-content: center;
  margin-top: 0px;
`;
